from socket import socket, AF_INET, SOCK_DGRAM, IPPROTO_UDP, SOL_SOCKET, SO_REUSEPORT, SO_BROADCAST
import threading
from json import dumps, loads
from tkinter import *
from base64 import b64decode
import time

class RX:
    def __init__(self) -> None:
        self.RX = socket(AF_INET, SOCK_DGRAM, IPPROTO_UDP)
        self.RX.setsockopt(SOL_SOCKET, SO_REUSEPORT, 1)
        self.RX.setsockopt(SOL_SOCKET, SO_BROADCAST, 1)
        self.port = 4454
        self.addr = ""
        self.ui = None

    def set(self, ui) -> None:
        self.ui = ui

    def bind(self):
        self.RX.bind((self.addr, self.port))
        while True:
            data, _ = self.RX.recvfrom(1024)
            self.ui.recive_msg(loads(data.decode()))


class TX:
    def __init__(self) -> None:
        self.TX = socket(AF_INET, SOCK_DGRAM, IPPROTO_UDP)
        self.TX.setsockopt(SOL_SOCKET, SO_REUSEPORT, 1)
        self.TX.setsockopt(SOL_SOCKET, SO_BROADCAST, 1)
        self.port = 4454

    def send(self, msg: dict) -> bool:
        self.TX.sendto(dumps(msg).encode(), ('<broadcast>', self.port))
        return True

class server_demon(threading.Thread):
    def __init__(self, rx: RX):
        super().__init__()
        self._stop_event = threading.Event()
        self.rx=rx

    def run(self):
        self.rx.bind()

    def stop(self):
        self._stop_event.set()

class UI:
    def __init__(self) -> None:
        self.tx = TX()
        self.rx = RX()

        self.rx.set(ui=self)

        self.t1 = None
        self.t2 = None

        self.cLc = 0
        self.label_list = []
        self.last_place = 400
        self.name_login = None

        self.window = Tk()
        self.window.protocol("WM_DELETE_WINDOW", self.stop_server)
        self.chatframe = Frame(self.window, height=600, width=400)
        self.login_frame = Frame(self.window, height=600, width=400, )
        self.logincanv = Canvas(self.login_frame, height=600, width=400, background="black")
        self.enter_name = Entry(self.login_frame, font=("Bell MT", 15), width=30, bg="#E6D39E", )
        self.chatcanv = Canvas(self.chatframe, height=600, width=400)
        self.msg_canv = Canvas(self.chatframe, height=450, width=350)
        self.text_enter = Entry(self.chatframe, font=("Amasis MT Pro", 15), bg="#000B0D", fg="white", width=28)

        self.loginBGimg = PhotoImage(data=b64decode(''''''))

        self.chatBGimg = PhotoImage(data=b64decode(''''''))

        self.Tchaticon = PhotoImage(data=b64decode(
            ''''''))
        self.loginiconpic = PhotoImage(data=b64decode(
            ''''''))
        self.up_label_img = PhotoImage(data=b64decode(
            ''''''))
        self.down_label_img = PhotoImage(data=b64decode(
            ''''''))
        self.sendIMG = PhotoImage(data=b64decode(
            ''''''))
        self.me_icon = PhotoImage(data=b64decode(
            ''''''))
        self.msg_BG = PhotoImage(data=b64decode(
            ''''''))
        self.next_icon = PhotoImage(data=b64decode(
            ''''''))
        self.msg_img = PhotoImage(data=b64decode(
            ''''''))

    def go_up(self, event):
        if self.label_list[self.cLc - 1].winfo_y() != 400:
            for i in self.label_list:
                x_val, y_val = i.winfo_x(), i.winfo_y()
                i.place(x=x_val, y=(y_val - 50))

    def go_down(self, event):
        if self.label_list[0].winfo_y() < 0:
            for i in self.label_list:
                x_val, y_val = i.winfo_x(), i.winfo_y()
                i.place(x=x_val, y=(y_val + 50))

    def scroll_wil_me(self, event):
        delta = event.delta // 120
        if delta > 0:
            if self.label_list[self.cLc - 1].winfo_y() == 400:
                pass

            else:
                for i in self.label_list:
                    x_val, y_val = i.winfo_x(), i.winfo_y()
                    i.place(x=x_val, y=(y_val - 50))

        elif delta < 0:
            if self.label_list[0].winfo_y() < 0:
                for i in self.label_list:
                    x_val, y_val = i.winfo_x(), i.winfo_y()
                    i.place(x=x_val, y=(y_val + 50))

    def recive_msg(self, data: dict):
        current_msg = data["msg"]
        sender_id = data["user"]
        if current_msg != "" and sender_id != self.name_login:
            for i in range(self.cLc):
                x_val, y_val = self.label_list[i].winfo_x(), self.label_list[i].winfo_y()
                self.label_list[i].place(x=x_val, y=(y_val - 50))
                self.last_place = self.label_list[i].winfo_y()

            label = Canvas(self.msg_canv, height=50, width=350)
            label.create_image(0, 0, image=self.msg_BG, anchor=NW)
            label.create_image(5, 5, image=self.me_icon, anchor=NW)
            label.create_text(5, 35, text=sender_id, fill="black", anchor=NW)
            label_msg = Label(label, text=current_msg, font=("arial", 12, "bold"), bg="#FFFFFF", fg="black")
            label_msg.place(x=50, y=10)
            self.label_list.append(label)
            self.label_list[self.cLc].place(x=0, y=self.last_place)
            self.cLc += 1

    def send_msg(self, event):
        current_msg = self.text_enter.get()
        self.text_enter.delete(0, END)

        if current_msg != "":
            data = {
                "user": self.name_login,
                "msg": current_msg
            }

            for i in range(self.cLc):
                x_val, y_val = self.label_list[i].winfo_x(), self.label_list[i].winfo_y()
                self.label_list[i].place(x=x_val, y=(y_val - 50))
                self.last_place = self.label_list[i].winfo_y()

            if self.tx.send(msg=data):
                label = Canvas(self.msg_canv, height=50, width=350, )
                label.create_image(0, 0, image=self.msg_BG, anchor=NW)
                label.create_image(310, 5, image=self.me_icon, anchor=NW)
                label.create_text(340, 35, text=self.name_login, fill="black", anchor=NE)
                label_msg = Label(label, text=current_msg, font=("arial", 12, "bold"), bg="#FFFFFF", fg="black")
                label_msg.place(x=300 - label_msg.winfo_reqwidth(), y=10)
                self.label_list.append(label)
                self.label_list[self.cLc].place(x=0, y=self.last_place)
                self.cLc += 1

    def login(self, event):
        self.name_login = self.enter_name.get()
        if self.name_login.isalpha():
            self.login_frame.destroy()
            self.chatframe.place(x=0, y=0)

    def create_window(self):
        self.window.title("TChat")
        self.window.geometry("400x600")
        self.window.iconphoto(True, self.Tchaticon)

        self.login_frame.pack(side="left", fill="both", expand=TRUE)
        self.logincanv.pack(side="left", fill="both", expand=TRUE)
        self.logincanv.create_image(0, 0, image=self.loginBGimg, anchor=NW)
        self.logincanv.create_image(85, 90, image=self.loginiconpic, anchor=NW)

        next_button = self.logincanv.create_image(165, 440, image=self.next_icon, anchor=NW)
        self.logincanv.tag_bind(next_button, "<Button-1>", self.login)

        self.enter_name.place(x=50, y=360, height=40)
        self.enter_name.bind("<Return>", self.login)

        self.chatcanv.place(x=-1, y=0)
        self.chatcanv.create_image(0, 0, image=self.chatBGimg, anchor=NW, )
        self.chatcanv.create_image(0, 0, image=self.up_label_img, anchor=NW)
        self.chatcanv.create_oval(5, 5, 55, 55, fill="#007325", width=0)

        self.chatcanv.create_text(15, 10, text="T", anchor=NW, font=("Algerian", 30), fill="white")
        self.chatcanv.create_text(30, 25, text="chat", anchor=NW, font=("Book Antiqua", 10), fill="white")
        self.chatcanv.create_image(0, 540, image=self.down_label_img, anchor=NW)
        send_button = self.chatcanv.create_image(345, 545, image=self.sendIMG, anchor=NW)  # continue here
        self.chatcanv.tag_bind(send_button, "<Button-1>", self.send_msg)

        self.msg_canv.place(x=25, y=80)
        self.msg_canv.create_image(1, 1, image=self.msg_img, anchor=NW, )
        self.msg_canv.bind_all("<MouseWheel>", self.scroll_wil_me)
        self.msg_canv.bind_all("<B1-Motion>", self.scroll_wil_me)

        self.text_enter.place(x=20, y=550, height=40)
        self.text_enter.bind("<Return>", self.send_msg)
        self.window.bind("<Up>", self.go_up)
        self.window.bind("<Down>", self.go_down)
        
    def loop(self):
        self.window.mainloop()
    
    def stop_server(self):
        self.t1.stop()

    def run(self):
        self.t1 = server_demon(rx=self.rx)
        self.t1.start()
        self.loop()
   



if __name__ == '__main__':
    core = UI()
    core.create_window()
    core.run()
